import { ReactSVG } from 'react-svg'

import './App.css';

//import profilePicture  from './images/profilePicture.png';
import FacebookIcon  from './images/Facebook Icon.svg';
import gitHubIcon from './images/GitHub Icon.svg';
import instagramIcon from './images/Instagram Icon.svg';
import mailIcon from './images/Mail.svg';
import twitterIcon from './images/Twitter Icon.svg';
import LinkedinIcon from './images/Linked in.svg';

const user = {
  name: "Laura Smith",
  proffesion: "Frontend Developer",
  profilePicturePath:  ".images/profilePicture.png",
  websiteAdress: "laurasmith.website",
  about: "I am a frontend developer with a particular interest in making things simple and automating daily tasks. I try to keep up with security and best practices, and am always looking for new things to learn.",
  interests: "Food expert. Music scholar. Reader. Internet fanatic. Bacon buff. Entrepreneur. Travel geek. Pop culture ninja. Coffee fanatic.",
 };

 const profilePicture = require (user.profilePicturePath);

function App() {
  return (
    <div className="App">
      <div className="Window">
        <img src={profilePicture} className="profile-photo" alt="profile"/>
        <h1>{user.name}</h1>
        <h3>{user.proffesion}</h3>
        <h4>{user.websiteAdress}</h4>
        <div className="buttons">
          <button id='butn Email'> <ReactSVG src={mailIcon} /> Email</button>
          <button id='button-LinkedIn'> <ReactSVG src={LinkedinIcon} /> Linkedin</button>
        </div>
        <div className='Description'>
          <h2>About</h2>
          <p>{user.about}</p>
          <h2>Interests</h2>
          <p>{user.interests}</p>
        </div>
        <div className='icons'>
          <ReactSVG src={twitterIcon} alt="twitter icon" />
          <ReactSVG src={FacebookIcon} alt="Facebook icon"/>
          <ReactSVG src={instagramIcon} alt="Instagram icon"/>
          <ReactSVG src={gitHubIcon} alt="GitHab icon"/>
        </div>
      </div>
    </div>
  );
}

export default App;
